sys_variable_value.value:
(function execute(inputs, outputs) {
    var vpc = new GoogleVPCUtils();
    vpc.validateInputVariables(inputs, outputs);
    vpc.validateMandatoryVariables(inputs, ['projectid', 'region', 'subnetwork', 'ipcidrrange']);
    vpc.maptoOutputFromInput(inputs, outputs, ['projectid', 'region', 'subnetwork']);
    var requestBody = {
        "ipCidrRange": inputs.ipcidrrange
    }
    outputs.requestbody = JSON.stringify(requestBody);
})(inputs, outputs);

